std::vector<long> rolling_max(std::vector<long> numbers) {
    std::vector<long> result;
    long max_so_far = numbers[0];
    result.push_back(max_so_far);
    for (size_t i = 1; i < numbers.size(); i++) {
        max_so_far = std::max(max_so_far, numbers[i]);
        result.push_back(max_so_far);
    }
    return result;

