// and false otherwise.
// Knowing that (a) is less then 100. 
// Example:
// >>> is_multiply_prime((30))
// (true)
// 30 = 2 * 3 * 5
bool is_multiply_prime(long a) {
    if (a < 6) return false;
    for (int i = 2; i <= sqrt(a); i++) {
        if (a % i == 0) {
            int b = a / i;
            if (i > b) break;
            if (i == 2 && b % 2 == 0) continue;
            if (i == 3 && b % 3 == 0) continue;
            if (i == 5 && b % 5 == 0) continue;
            if (i == 7 && b % 7 == 0) continue;
            return true;
        }
    }
    return false;

