// Write a function that takes a message, and encodes in such a 
// way that it swaps case of all letters, replaces all vowels in 
// the message with the letter that appears 2 places ahead of that 
// vowel in the english alphabet. 
// Assume only letters. 
// Examples:
// >>> encode(("test"))
// ("TGST")
// >>> encode(("This is a message"))
// ("tHKS KS C MGSSCGG")
std::string encode(std::string message) {
    std::string vowels = "aeiouAEIOU";
    std::string result = "";
    for (int i = 0; i < message.size(); i++) {
        if (vowels.find(message[i]) != std::string::npos) {
            result += (message[i] >= 'a' && message[i] <= 'z') ? (char)((message[i] - 'a' + 2) % 26 + 'a') : (char)((message[i] - 'A' + 2) % 26 + 'A');
        } else {
            result += (message[i] >= 'a' && message[i] <= 'z') ? (char)(std::toupper(message[i])) : (char)(std::tolower(message[i]));
        }
    }
    return result;

