        if (i >= 1 && i <= 9) {
            temp.push_back(i);
        }
    }
    std::sort(temp.begin(), temp.end());
    std::reverse(temp.begin(), temp.end());
    for (auto i : temp) {
        result.push_back(names[i - 1]);
    }
    return result;

