// Examples
// >>> is_sorted((std::vector<long>({(long)5})))
// (true)
// >>> is_sorted((std::vector<long>({(long)1, (long)2, (long)3, (long)4, (long)5})))
// (true)
// >>> is_sorted((std::vector<long>({(long)1, (long)3, (long)2, (long)4, (long)5})))
// (false)
// >>> is_sorted((std::vector<long>({(long)1, (long)2, (long)3, (long)4, (long)5, (long)6})))
