// in the extension's name, the strength is given by the fraction CAP - SM. 
// You should find the strongest extension and return a string in this 
// format: ClassName.StrongestExtensionName.
// If there are two or more extensions with the same strength, you should
// choose the one that comes first in the vector.
// For example, if you are given "Slices" as the class and a vector of the
// extensions: ['SErviNGSliCes', 'Cheese', 'StuFfed'] then you should
// return 'Slices.SErviNGSliCes' since 'SErviNGSliCes' is the strongest extension 
// (its strength is -1).
// Example:
// >>> Strongest_Extension(("my_class"), (std::vector<std::string>({(std::string)"AA", (std::string)"Be", (std::string)"CC"})))
// ("my_class.AA")
std::string Strongest_Extension(std::string class_name, std::vector<std::string> extensions) {
    int max_strength = -1000000000;
    std::string strongest_extension;
    for (std::string extension : extensions) {
        int cap = 0, sm = 0;
        for (char c : extension) {
            if (isupper(c)) {
                cap++;
            } else if (islower(c)) {
                sm++;
            }
        }
        int strength = cap - sm;
        if (strength > max_strength) {
            max_strength = strength;
            strongest_extension = extension;
        }
    }
    return class_name + "." + strongest_extension;

