std::string int_to_mini_roman(long number) {
    assert(number >= 1 && number <= 1000);
    std::string roman_numerals[] = {"i", "v", "x", "l", "c", "d", "m"};
    std::string result;
    int index = 0;
    while (number > 0) {
        int digit = number % 10;
        number /= 10;
        if (digit < 4) {
            for (int i = 0; i < digit; i++) {
                result = roman_numerals[index] + result;
            }
        } else if (digit == 4) {
            result = roman_numerals[index] + roman_numerals[index + 1] + result;
        } else if (digit < 9) {
            result = roman_numerals[index + 1] + roman_numerals[index] * (digit - 5) + result;
        } else {
            result = roman_numerals[index] + roman_numerals[index + 2] + result;
        }
        index += 2;
    }
    return result;

